import { Columns, Column, Hero, HeroBody,
    Title, Subtitle, Section 
} from 'bloomer';
import Tiles from './Tiles';
import CardItem from './CardItem';
import SimpleInput from '../SimpleInput';
import Activity from './Activity';
import styles from '../styles';

export default function Dashboard({ profile }) {
    return (
        <Column isSize={9}>
            <Hero isColor="primary" isSize="small" style={styles.gradient}>
                <HeroBody>
                    <Title>Olá, {profile.name}</Title>
                    <Subtitle>Tenha um ótimo dia!</Subtitle>
                </HeroBody>
            </Hero>
            <Section>
                <Tiles />
            </Section>
            <Columns>
                <Column isSize={6}>
                    <CardItem title="Feed de Atividades">
                        <Activity />
                        <Activity />
                    </CardItem>
                </Column>
                <Column isSize={6}>
                    <SimpleInput />
                    <CardItem title="Progressão Mensal" />
                </Column>
            </Columns>
        </Column>
    );
}
